import React from 'react';
import './Schedule.css';
import Week from './ScheduleD';
import ScheduleW from './ScheduleW';

const Schedule = () => {
    return (
        <>
            <header>
                <p>Harmonogram zajęć</p>
            </header>
            <article>
                <ScheduleW />
                <ScheduleD />
            </article>
        </>
    );
}

export default Schedule;
